import React from 'react'
import './App.css'

class App extends React.Component {
  constructor (props) {
    super(props)
    this.state = { value: null }
  }

  render () {
    return (
      <>
        <TestView value={this.state.value} />
      </>
    )
  }
}

const TestView = props => {
  return (
    <h1>{props.value}</h1>
  )
}
export default App
